import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { AuthService } from '../auth.service';
import { User } from '../User';
import { HttpClient } from '@angular/common/http';
import { Router } from '@angular/router';


@Component({
  selector: 'app-registration',
  templateUrl: './registration.component.html',
  styleUrls: ['./registration.component.css']
})
export class RegistrationComponent  {
  username: string |any;
  password: string |any;
  role: string |any;
  registerForm: FormGroup;

  constructor(private http: HttpClient,private authService: AuthService, private router:Router,private formBuilder: FormBuilder) { }

  ngOnInit() {
    this.registerForm = this.formBuilder.group({
      username: ['', Validators.required],
      password: ['', Validators.required],
      role: ['', Validators.required]
    });
  }

  register() {
    const user = {
      username: this.username,
      password: this.password,
      role: this.role
    };

    this.http.post('http://localhost:3000/authRoutes/register', user)
      .subscribe(
        (response:any) => {
          console.log(response);
          alert('Registration Successful!');
          this.router.navigate(['/login']);

          // Handle success message or redirect to login page
        },
        error => {
          console.error(error);
          alert('Registration Failed!');
          // Handle error message
        }
      );
  }


}
<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Login - Hospital Management App</title>
    <!-- Bootstrap CSS -->
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/5.0.2/css/bootstrap.min.css" />
</head>

<body>
<div class="container p-5">
  <div class="row">
    <div class="col-md-6">
      <img src="https://thumbs.dreamstime.com/b/woman-register-medical-record-nurse-help-patient-registration-nursing-profession-banner-receptionist-form-computer-senior-179773480.jpg " alt="Image" class="img-fluid">
    </div>
    <div class="col-md-6">
      <div class="login-container p-4">
        <h1 class="stylish-heading text-center mb-3">Join HMS and be Healthy!</h1>
        <form [formGroup]="registerForm" (ngSubmit)="register()">
          <div class="form-group">
            <label for="username"><i class="bi bi-person-fill"></i> Username:</label>
            <input type="text" id="username" class="form-control" formControlName="username">
            <div *ngIf="registerForm.controls['username'].invalid && registerForm.controls['username'].touched">
              <div *ngIf="registerForm.controls['username'].hasError('required')">Username is required</div>
            </div>
          </div>
          <div class="form-group">
            <label for="password"><i class="bi bi-lock-fill"></i> Password:</label>
            <input type="password" id="password" class="form-control" formControlName="password">
            <div *ngIf="registerForm.controls['password'].invalid && registerForm.controls['password'].touched">
              <div *ngIf="registerForm.controls['password'].hasError('required')">Password is required</div>
            </div>
          </div>
          <div class="form-group">
            <label for="role"><i class="bi bi-people-fill"></i> Role:</label>
            <select id="role" class="form-control" formControlName="role">
              <option value="doctor">Doctor</option>
              <option value="patient">Patient</option>
            </select>
            <div *ngIf="registerForm.controls['role'].invalid && registerForm.controls['role'].touched">
              <div *ngIf="registerForm.controls['role'].hasError('required')">Role is required</div>
            </div>
          </div>
          <button type="submit" class="btn btn-primary mt-3" [disabled]="registerForm.invalid"><i class="bi bi-person-plus"></i> Register</button>
        </form>
      </div>
    </div>
  </div>
</div>
    <!-- Bootstrap JS -->
    <script src="https://cdnjs.cloudflare.com/ajax/libs/bootstrap/5.0.2/js/bootstrap.bundle.min.js"></script>
</body>

</html>
